
CREATE TABLE IF NOT EXISTS `orders_s` (
    `Order_ID` VARCHAR(13) CHARACTER SET utf8,
    `Order_Date` DATETIME,
    `Customer_ID` VARCHAR(14) CHARACTER SET utf8,
    `Product_ID` VARCHAR(7) CHARACTER SET utf8,
    `Quantity` INT
);
    
--
CREATE TABLE IF NOT EXISTS `customers_s` (
    `Customer_ID` VARCHAR(14) CHARACTER SET utf8,
    `Customer_Name` VARCHAR(22) CHARACTER SET utf8,
    `Email` VARCHAR(38) CHARACTER SET utf8,
    `Phone_Number` VARCHAR(19) CHARACTER SET utf8,
    `Address_Line_1` VARCHAR(26) CHARACTER SET utf8,
    `City` VARCHAR(19) CHARACTER SET utf8,
    `Country` VARCHAR(14) CHARACTER SET utf8,
    `Postcode` VARCHAR(5) CHARACTER SET utf8,
    `Loyalty_Card` VARCHAR(3) CHARACTER SET utf8
);

--

CREATE TABLE IF NOT EXISTS `products_s` (
    `Product_ID` VARCHAR(7) CHARACTER SET utf8,
    `Coffee_Type` VARCHAR(3) CHARACTER SET utf8,
    `Roast_Type` VARCHAR(1) CHARACTER SET utf8,
    `Size` NUMERIC(2, 1),
    `Unit_Price` NUMERIC(18, 16),
    `Price_per_100g` NUMERIC(17, 16),
    `Profit` NUMERIC(18, 17)
);

